import React from 'react'
import CardList from "./cardlist";
import { robots } from "./robots";

const App = () => {
    return (
        <div className="tc">
            <h2>robofriends</h2>
            <input className="" placeholder="search robot"></input>
            <CardList robots={robots} />
        </div>
    );
}

export default App;
